import React from 'react'
import { Container } from "react-bootstrap";

import EuroService from "../../service/Euromillon.service";


class Euromillon extends Component {
  constructor(props) {
    super(props);
    this._service = new Service();
    this.state = {
      showToast: false,
      toastText: "",
      user: { username: "", password: "" }
    };
  }
  render() {
    return (
      <Container>
        <section>
          <h1>Euromillones</h1>
        </section>
      </Container>
    );
  }
}


export default Euromillon
